const a="Coqueiro Seco",e='Cidade lagunar conhecida como a "catedral da cultura popular"',o=[{location:{lat:-9.6765595,line:!0,lon:-35.8296301,zoom:14},icon:{iconUrl:"/imgs/pin.svg",iconSize:[48,48]},media:{url:"https://vimeo.com/695445881/1ea8cbb0fb",type:"video"},text:{headline:"Santu\xE1rio Nossa senhora dos Rem\xE9dios",text:"<span>Igreja que promove a tradicional Festa dos Rem\xE9dios, em 16 de outubro, festejo popular que promove uma prociss\xE3o e finaliza com a chegada \xE0 igreja.</span>"}},{icon:{iconUrl:"/imgs/pin.svg",iconSize:[48,48]},location:{lat:-9.6710447,line:!0,lon:-35.7930051,zoom:14},media:{caption:"",credit:"",url:"https://vimeo.com/695480487/24b6d87b7e",type:"video"},text:{headline:"Restaurante do Renaldo",text:"<span>O Restaurante do Renaldo, situado \xE0 beira da Lagoa Munda\xFA, come\xE7ou como um barzinho, em casa, h\xE1 mais de 30 anos. Hoje, a vi\xFAva de Renaldo, Dona Lurdes, e os filhos deles, administram o restaurante, com hor\xE1rio de funcionamento alinhado \xE0 rotina dos pescadores da regi\xE3o, que entregam-lhes os mais frescos peixes e mariscos. Os pratos mais famosos s\xE3o o fil\xE9 de siri na manteiga e a fritada mista. O restaurante fica no povoado Cadoz, no munic\xEDpio alagoano de Coqueiro Seco.</span><br>"}},{icon:{iconUrl:"/imgs/pin.svg",iconSize:[48,48]},location:{lat:-9.6358823,line:!0,lon:-35.797638917,zoom:14},media:{caption:"",credit:"",type:"image",url:"coqueiroseco01.jpg"},text:{headline:"Restaurante Recanto dos Amigos",text:"<span>Localizado no povoado Cadoz, \xE9 pr\xF3ximo da beira da Lagoa Munda\xFA e da subida do Mirante. Servem pratos da culin\xE1ria tradicional de Coqueiro Seco, como peixes, mariscos e outros frutos do mar.</span>"}},{icon:{iconUrl:"/imgs/pin.svg",iconSize:[48,48]},location:{lat:-9.6696215,line:!0,lon:-35.7904702,zoom:14},media:{caption:"",credit:"",type:"image",url:"coqueiroseco02.jpg"},text:{headline:"Pra\xE7a do Cadoz",text:"<span>Frequentado pela comunidade, o local recebe apresenta\xE7\xF5es culturais e \xE9 ponto de trabalho dos marisqueiros.</span>"}},{icon:{iconUrl:"/imgs/pin.svg",iconSize:[48,48]},location:{lat:-9.6389457,line:!0,lon:-35.8111053,zoom:14},media:{caption:"",credit:"",type:"image",url:"coqueiroseco03.jpg"},text:{headline:"Restaurante da Dona Lucia",text:"<span>Restaurante self-service e comercial. Trabalha com entregas.</span>"}},{icon:{iconUrl:"/imgs/pin.svg",iconSize:[48,48]},location:{lat:-9.6386526,line:!0,lon:-35.7910396,zoom:14},media:{caption:"",credit:"",url:"https://vimeo.com/695458175/af61a5109e",type:"video"},text:{headline:"Ciclovia",text:"<span>Ciclovia est\xE1 em constru\xE7\xE3o. \xC9 utilizada pela comunidade que faz caminhadas e recebe alguns grupos de ciclistas.</span>"}},{icon:{iconUrl:"/imgs/pin.svg",iconSize:[48,48]},location:{lat:-9.6358823,line:!0,lon:-35.797638917,zoom:14},media:{caption:"",credit:"",type:"image",url:"coqueiroseco04.jpg"},text:{headline:"Restaurante Brisa da Lagoa",text:"<span>Localizado \xE0s margens da Lagoa Munda\xFA, com acesso pela via litor\xE2nea de Coqueiro Seco. Ambiente acolhedor e confort\xE1vel, servindo pratos como arroz de polvo e a famosa peixada.</span>"}},{icon:{iconUrl:"/imgs/pin.svg",iconSize:[48,48]},location:{lat:-9.6341291,line:!0,lon:-35.7935303,zoom:14},media:{caption:"",credit:"",type:"image",url:"coqueiroseco05.jpg"},text:{headline:"Casa do Jurista",text:"<span>Pr\xE9dio da cidade de Coqueiro Seco que mant\xE9m a arquitetura preservada desde sua constru\xE7\xE3o.</span>"}},{icon:{iconUrl:"/imgs/pin.svg",iconSize:[48,48]},location:{lat:-9.637395394476911,line:!0,lon:-35.790971612725286,zoom:14},media:{caption:"",credit:"",url:"https://vimeo.com/695449723/0d78e0d1f1",type:"video"},text:{headline:"Orla",text:"<span>A orla de Coqueiro Seco est\xE1 em amplia\xE7\xE3o, mas j\xE1 \xE9 um espa\xE7o muito frequentado por moradores, pescadores que trabalham no local e visitantes que fazem fotos das paisagens e da vista para a capital Macei\xF3.</span><br>"}},{icon:{iconUrl:"/imgs/pin.svg",iconSize:[48,48]},location:{lat:-9.63837726207149,line:!0,lon:-35.8013600309053,zoom:12},media:{caption:"",credit:"",url:"https://vimeo.com/695487399/98fb32ad63",type:"video"},text:{headline:"Ladeiras",text:"<span>Vista privilegiada da capital pela orla de Coqueiro Seco.</span>"}},{icon:{iconUrl:"/imgs/pin.svg",iconSize:[48,48]},location:{lat:-9.6374548,line:!0,lon:-35.7952413,zoom:14},media:{caption:"",credit:"",type:"image",url:"coqueiroseco06.jpg"},text:{headline:"Igreja Matriz de Nossa Senhora M\xE3e dos Homens",text:"<span>Igreja matriz da cidade, recentemente reformada. Recebe muitos visitantes e tem um grande p\xFAblico de fi\xE9is. Promove sua principal festa popular no m\xEAs de janeiro, mobilizando a cidade e o com\xE9rcio local.</span>"}},{icon:{iconUrl:"/imgs/pin.svg",iconSize:[48,48]},location:{lat:-9.638808,line:!0,lon:-35.790529,zoom:16},media:{caption:"",credit:"",type:"image",url:"coqueiroseco07.jpg"},text:{headline:"Col\xF4nia de Pescadores",text:"<span>Ponto de encontro dos pescadores na orla de Coqueiro Seco. No mesmo lugar funciona tamb\xE9m a Capela de S\xE3o Pedro. L\xE1 s\xE3o realizados eventos religiosos, reuni\xF5es e articula\xE7\xE3o dos pescadores.</span><br>"}},{icon:{iconUrl:"/imgs/pin.svg",iconSize:[48,48]},location:{lat:-9.634282325985568,line:!0,lon:-35.78817844390869,zoom:16},media:{caption:"",credit:"",type:"image",url:"coqueiroseco08.jpg"},text:{headline:"Dona Noemia",text:"<span>Personalidade que carrega muitas hist\xF3rias, viv\xEAncias, mem\xF3ria cultural.</span>"}},{icon:{iconUrl:"/imgs/pin.svg",iconSize:[48,48]},location:{lat:-9.6358823,line:!0,lon:-35.7976389,zoom:15},media:{caption:"",credit:'"[Celular Monique  T5i] Tarde "',type:"image",url:"coqueiroseco12.jpg"},text:{headline:"Casa de Dona Carminha",text:"<span>Dona Carminha \xE9 figura p\xFAblica conhecida de Coqueiro Seco, onde conduz o Projeto Boleiras das Alagoas, com apoio da Embrapa, vendendo bolos tradicionais, p\xE9 de moleque na palha da bananeira, grude de gome, tapioca, brasileira, entre outros quitutes. Passa o ensinamento para outras mulheres da regi\xE3o. Contribui para a manuten\xE7\xE3o de diversos folguedos da cidade, como chegan\xE7a, pastoril e baianas.</span><br>"}},{icon:{iconUrl:"/imgs/pin.svg",iconSize:[48,48]},location:{lat:-9.6358823,line:!0,lon:-35.797638917,zoom:14},media:{caption:"",credit:"",type:"image",url:"coqueiroseco09.jpg"},text:{headline:"Artesanato do Seu Armando",text:"<span>Seu Armando \xE9 um artes\xE3o da regi\xE3o que trabalha com m\xF3veis de madeira, palha e outros itens de decora\xE7\xE3o que revende para lojas em Coqueiro Seco e outras cidades pr\xF3ximas. Trabalha confeccionando pe\xE7as sob encomenda e com mercadorias prontas.</span><br>"}},{icon:{iconUrl:"/imgs/pin.svg",iconSize:[48,48]},location:{lat:-9.6358823,line:!0,lon:-35.797638917,zoom:14},media:{caption:"",credit:"",type:"image",url:"coqueiroseco10.jpg"},text:{headline:"Suites do Campo",text:"<span>Estabelecimento tur\xEDstico de hospedagem.</span>"}},{icon:{iconUrl:"/imgs/pin.svg",iconSize:[48,48]},location:{lat:-9.6358823,line:!0,lon:-35.797638917,zoom:14},media:{caption:"",credit:"",type:"image",url:"coqueiroseco11.jpg"},text:{headline:"P\xF4r do Sol no Bairro Bras\xEDlia",text:"<span>Local frequentado pela comunidade, que se re\xFAne para apreciar a bela vista e tirar fotos do p\xF4r do sol. Fica no alto de Coqueiro Seco.</span>"}}],i=[{section:"oficinas",values:[{title:"V\xEDdeo",names:["Kaio Andr\xE9 da Silva","Monique Ariane dos Santos"]},{title:"Fotografia",names:["Bernardo Augusto de Oliveira Silva","Djalma Santos","Fernando Jos\xE9 Da Silva","Ixchel Mary","Iasmym Crislane Bulh\xF5es da Silva","Josualdo Jos\xE9 dos Santos","Samuel Henrique Silva de Melo"]},{title:"Atua\xE7\xE3o para Redes Sociais",names:["Monique Ariane dos Santos","Kaio Andr\xE9 da Silva"]},{title:"Produ\xE7\xE3o",names:["Juliana Franklin","Nayran Lima"]},{title:"Edi\xE7\xE3o",names:["Allysson Amaral","Joana Moura"]},{title:"Programa\xE7\xE3o",names:["Daniel Wallison","Wesley Amaro"]}]},{section:"extras",values:[{title:"M\xFAsicas",names:["Chegan\xE7a Silva Jardim","Baianas Voltam a Sorrir","Associa\xE7\xE3o musical professor Francisco Pedrosa"]},{title:"Imagens de Drone",names:["Djalma Santos"]},{title:"Motorista",names:["Marcos Antonio"]},{title:"Apoio aos cuidados da casa e alimenta\xE7\xE3o",names:["Vera Lucia dos Santos"]}]},{section:"agradecimentos",values:[{title:"",names:["Prefeitura de Coqueiro Seco em especial a Prefeita Decele Damaso","Chefe de gabinete na pessoa de Daniele Melo","Secretaria de Cultura na pessoa de J\xF4 Rodrigues","Secretaria de Turismo na pessoa de Betania Barros","Secretaria de Assist\xEAncia Social na pessoa de C\xE9lia Barros"]},{title:"Aos agentes culturais que facilitaram e acolheram t\xE3o bem a equipe do projeto",names:["Nayran Lima","Juliana Franklin","Francys Adriano","Caio Cesar"]},{title:"Cozinheiras",names:["Jessica Regina","M\xE1rcia","Sirlene","Bianca","Paola","Lindenez","Alclevia Alves"]},{title:"Equipe Cras",names:["Leonardo Lins","Tadeu Duarte"]},{title:"Desenvolvimento de metodologia",names:["Amanda Moa","Evelyn Gomes","Eduardo Liron","Glauber Xavier"]},{title:"Produ\xE7\xE3o",names:["Renata Czarny"]}]}],n={name:a,info:e,slides:o,about:i},t="Jequi\xE1 da Praia",r="O munic\xEDpio com a terceira maior lagoa do Brasil",s=[{icon:{iconUrl:"/imgs/pin.svg",iconSize:[48,48]},location:{lat:-9.96793,line:!0,lon:-35.97724,zoom:12},media:{caption:"",credit:"",url:"https://vimeo.com/697944659/c9db4ab24a",type:"video"},text:{headline:"Passeio pela Hist\xF3ria de Jequi\xE1",text:"<span>Trajeto do in\xEDcio de Jequi\xE1 da Praia at\xE9 o Campo da Lagoa.</span><br>"}},{icon:{iconUrl:"/imgs/pin.svg",iconSize:[48,48]},location:{lat:-9.96307,line:!0,lon:-35.97346,zoom:12},media:{caption:"",credit:"",url:"jequia0.jpg",type:"image"},text:{headline:"Praia da Lagoa Azeda",text:"<div><span>A praia de Lagoa Azeda fica localizada no povoado de mesmo title, no munic\xEDpio de Jequi\xE1 da Praia. \xC9 ponto de concentra\xE7\xE3o da pesca marinha da regi\xE3o. L\xE1 tamb\xE9m acontece, anualmente, no m\xEAs de outubro, a peregrina\xE7\xE3o de S\xE3o Sebasti\xE3o. <br></span></div><div><br><span></span></div>"}},{icon:{iconUrl:"/imgs/pin.svg",iconSize:[48,48]},location:{lat:-9.96608355572431,line:!0,lon:-35.98319405391994,zoom:12},media:{caption:"",credit:"https://vimeo.com/saudaveissubversivos",url:"https://vimeo.com/697912100/c8db88353f",type:"video"},text:{headline:"Naufr\xE1gio do Itapaj\xE9",text:"}<span>A 25&nbsp;km de profundidade no mar, existe o navio naufragado ap\xF3s bombardeio no per\xEDodo da 2.\xAA guerra mundial. O local ainda \xE9 visitado por mergulhadores e pescadores da regi\xE3o, que recolhem materiais das cargas que o navio carregava.</span><br>"}},{icon:{iconUrl:"/imgs/pin.svg",iconSize:[48,48]},location:{lat:-9.96793,line:!0,lon:-35.97724,zoom:12},media:{caption:"",credit:"",url:"https://vimeo.com/697941483/8c0cc73f25",type:"video"},text:{headline:"Tingui: O Mist\xE9rio da Lagoa Azeda",text:"<span>No povoado de Lagoa Azeda ronda o mist\xE9rio do Tingui, flor que se abre nas pedras conhecidas como baixas, exala um cheiro de peixe podre e causa uma doen\xE7a desconhecida. Com isso, a popula\xE7\xE3o do povoado migra para os ranchos.</span><br>"}},{icon:{iconUrl:"/imgs/pin.svg",iconSize:[48,48]},location:{lat:-10.013555,line:!0,lon:-36.022995,zoom:12},media:{caption:"",credit:"",url:"https://vimeo.com/697969673",type:"video"},text:{headline:"Emp\xF3rio Caxang\xE1",text:"<div><span>Eliana Reis tem 57 anos, \xE9 artes\xE3 nascida e criada em Jequi\xE1 da Praia. Faz artesanato desde os 12 anos. Suas artes s\xE3o produzidas com mat\xE9rias-primas como papel\xE3o, casco de coco, fibra de bananeira e outros.</span></div><br>"}},{icon:{iconUrl:"/imgs/pin.svg",iconSize:[48,48]},location:{lat:-9.95647,line:!0,lon:-36.02304,zoom:12},media:{caption:"",credit:"Fotografia: Renan Carvalho",url:"jequia1.jpg",type:"image"},text:{headline:"Igreja Matriz Nossa Senhora do Pilar",text:"<div><span>A Igreja Matriz Nossa Senhora do Pilar, localizada na Rua da Igreja, centro de Jequi\xE1 da Praia, Alagoas, tem 260 anos de muita hist\xF3ria e tradi\xE7\xE3o. Tem como padroeira Nossa Senhora do Pilar e co-padroeiro o M\xE1rtir S\xE3o Sebasti\xE3o.<br></span></div><div><br><span></span></div>"}},{icon:{iconUrl:"/imgs/pin.svg",iconSize:[48,48]},location:{lat:-10.012086148955978,line:!0,lon:-36.02336731130825,zoom:12},media:{caption:"",credit:"Fotografia: Renan Carvalho",url:"jequia2.jpg",type:"image"},text:{headline:"Pra\xE7a Jos\xE9 Pacheco",text:"<span>A Pra\xE7a Jos\xE9 Pacheco est\xE1 localizada na Rua da Igreja, em frente \xE0 Prefeitura Municipal de Jequi\xE1 da Praia, Alagoas. \xC9 ponto de encontro de jovens e adultos, movimentada principalmente no per\xEDodo da noite, com lanchonetes ao redor.</span><br>"}},{icon:{iconUrl:"/imgs/pin.svg",iconSize:[48,48]},location:{lat:-10.04975,line:!0,lon:-36.031353,zoom:12},media:{caption:"",credit:"",url:"https://vimeo.com/697957209/05f4470cf0",type:"video"},text:{headline:"Artes\xE3o Seu Mauro",text:"<span>Artista que trabalha com madeira talhada com vidro. \xC9 poss\xEDvel visitar a loja dele, em Jequi\xE1 da Praia, onde al\xE9m de suas pe\xE7as ele tamb\xE9m comercializa cacha\xE7as artesanais produzidas na regi\xE3o.</span><br>"}},{icon:{iconUrl:"/imgs/pin.svg",iconSize:[48,48]},location:{lat:-10.009341,line:!0,lon:-36.0239398,zoom:12},media:{caption:"",credit:"Fotografia: Luiz Henrique",url:"jequia3.jpg",type:"image"},text:{headline:"Lanchonete da Maria",text:"<span>Oferece um dos melhores salgados da regi\xE3o h\xE1 25 anos, compartilhando sabores \xFAnicos de gera\xE7\xE3o a gera\xE7\xE3o.</span><br>"}},{icon:{iconUrl:"/imgs/pin.svg",iconSize:[48,48]},location:{lat:-10.01122,line:!0,lon:-36.024173,zoom:12},media:{caption:"",credit:"Fotografia: Luiz Henrique",url:"jequia4.jpg",type:"image"},text:{headline:"Feira de Jequi\xE1",text:"<div><span>A Feira Municipal de Jequi\xE1 da Praia acontece todo s\xE1bado, na parte da manh\xE3, na Rua do Oitizeiro, centro da cidade. Feirantes vendem frutas, verduras, carnes, peixes, temperos, ervas, bolachas, lanches e outros produtos. O local \xE9 tamb\xE9m um ponto de encontro para a popula\xE7\xE3o.<br></span></div><div><br><span></span></div>"}},{icon:{iconUrl:"/imgs/pin.svg",iconSize:[48,48]},location:{lat:-10.01077,line:!0,lon:-36.02495,zoom:12},media:{caption:"",credit:"Fotografia: Renan Carvalho",url:"jequia5.jpg",type:"image"},text:{headline:"Lanchonete 3 Irm\xE3os",text:"<span>A Lanchonete 3 irm\xE3os, que tem como dono o jequiaense Erasmo Carlos, come\xE7ou com um trailer, e agora tem uma \xF3tima estrutura para receber os clientes. Os lanches mais pedidos s\xE3o o x-burguer e o x-frango. Atende apenas \xE0 noite e costuma fechar cedo, por ter muita procura.</span><br>"}},{icon:{iconUrl:"/imgs/pin.svg",iconSize:[48,48]},location:{lat:-10.0092481,line:!0,lon:-36.0242402,zoom:12},media:{caption:"",credit:"Fotografia: Deyvillanne Fidelis",url:"jequia6.jpg",type:"image"},text:{headline:"Pra\xE7a de Eventos Napole\xE3o Martins",text:"<span>Rec\xE9m-inaugurada, com espa\xE7o para exerc\xEDcios e divers\xE3o para as crian\xE7as, a Pra\xE7a de Multieventos da Orla est\xE1 localizada ao lado do gin\xE1sio poliesportivo Jos\xE9 Jarbas de Castro e tem como principal atra\xE7\xE3o a vista para o Rio Jequi\xE1.</span><br>"}},{icon:{iconUrl:"/imgs/pin.svg",iconSize:[48,48]},location:{lat:-10.0103585,line:!0,lon:-36.0213147,zoom:12},media:{caption:"",credit:"",url:"https://vimeo.com/697971494",type:"video"},text:{headline:"Rio da Espera",text:"<span>Localizado na cidade de Jequi\xE1 da Praia, o lugar tem rio e a \xE1rvore centen\xE1ria, a mais antiga da regi\xE3o, e o antigo casar\xE3o, demolido h\xE1 anos. \xC9 frequentado por moradores em momentos de lazer.</span><br>"}},{icon:{iconUrl:"/imgs/pin.svg",iconSize:[48,48]},location:{lat:-10.009804909285357,line:!0,lon:-36.024286595687016,zoom:12},media:{caption:"",credit:"Fotografia: Deyvillanne Fidelis",url:"jequia7.jpg",type:"image"},text:{headline:"Rio Jequi\xE1",text:"<span>Com cerca de 100&nbsp;km, o Rio Jequi\xE1 se tornou um dos principais rios de Alagoas. Com nascente localizada em Campo Alegre-AL, entrando na cidade de Jequi\xE1 da Praia, forma-se a terceira maior lagoa do estado, desaguando no mar no povoado Barra de Jequi\xE1. Seu principal fen\xF4meno \xE9 o encontro com a Laguna Jequi\xE1. Fonte de renda para muitos jequiaenses, pelo turismo, culin\xE1ria e a pesca, sendo a principal fonte de renda de muitos pescadores.</span><br>"}},{icon:{iconUrl:"/imgs/pin.svg",iconSize:[48,48]},location:{lat:-10.04706,line:!0,lon:-36.02854,zoom:12},media:{caption:"",credit:"",url:"//uploads.knightlab.com/storymapjs/c35fa21be0f6ec151b0aa2c5425efc86/jequia-da-praia/_images/51994984273_3b8a14b0cf_o.jpg"},text:{headline:"Trilha dos Caet\xE9s",text:"<span>Passeio subindo as margens do rio, com paradas para acesso a Pedras Grandes, onde \xE9 poss\xEDvel ver a linda paisagem de um lado e o mar do outro; seguindo no passeio de barco, pela regi\xE3o dos mangues \xE9 poss\xEDvel tomar o rejuvenescedor banho de lama e ver caranguejos. S\xE3o 16 km de rio e o passeio tem dura\xE7\xE3o de 40 minutos a uma hora</span><br>"}},{icon:{iconUrl:"/imgs/pin.svg",iconSize:[48,48]},location:{lat:-10.01153664813242,line:!0,lon:-36.026332289140655,zoom:12},media:{caption:"",credit:"Fotografia: Thaysia Marques",url:"jequia8.jpg",type:"image"},text:{headline:"Pra\xE7a Jos\xE9 Cassimiro",text:"<span>A Pra\xE7a Jos\xE9 Cassimiro \xE9 um \xF3timo local para a pr\xE1tica de esportes, com quadra, e tamb\xE9m de divers\xE3o para as crian\xE7as, com um espa\xE7o grande para as pessoas curtirem</span><br>"}},{icon:{iconUrl:"/imgs/pin.svg",iconSize:[48,48]},location:{lat:-10.01071,line:!0,lon:-36.026119,zoom:12},media:{caption:"",credit:"Fotografia: Luiz Henrique",url:"jequia9.jpg",type:"image"},text:{headline:"Restaurante do Sebal",text:"<span>Tradicional peixada e petiscaria da regi\xE3o, servindo a fam\xEDlias e amigos h\xE1 mais de 20 anos.</span><br>"}},{icon:{iconUrl:"/imgs/pin.svg",iconSize:[48,48]},location:{lat:-10.010216062405373,line:!0,lon:-36.025783724061895,zoom:12},media:{caption:"",credit:"Fotografia: Renan Carvalho",url:"jequia10.jpg",type:"image"},text:{headline:"Restaurante da Grinaura",text:"<span>Um dos melhores restaurantes para almo\xE7os entre fam\xEDlia e amigos, com servi\xE7o de self-service com gastronomia local e bebidas artesanais da regi\xE3o.</span><br>"}},{icon:{iconUrl:"/imgs/pin.svg",iconSize:[48,48]},location:{lat:-10.010266,line:!0,lon:-36.025702,zoom:12},media:{caption:"",credit:"",url:"jequia11.jpg",type:"image"},text:{headline:"Capela de Santa Cruz",text:"<span>A Capela Santa Cruz, localizada na Rua Santa Cruz, centro de Jequi\xE1 da Praia-AL, tem 144 anos de hist\xF3ria. Uma das principais festas realizadas na Capela \xE9 a de S\xE3o Jo\xE3o, que acontece em junho.</span><br>"}},{icon:{iconUrl:"/imgs/pin.svg",iconSize:[48,48]},location:{lat:-10.0082187,line:!0,lon:-36.0274935,zoom:12},media:{caption:"",credit:"Fotografia: Luiz Henrique",url:"jequia12.jpg",type:"image"},text:{headline:"Capela de Santo Ant\xF4nio",text:"<span>A Capela de Santo Ant\xF4nio, localizada na Rua Santo Ant\xF4nio, centro de Jequi\xE1 da Praia \u2014 AL, tem 152 anos de hist\xF3ria. A festa do santo, que ocorre em junho, movimenta toda a comunidade e a cidade de Jequi\xE1.</span><br>"}},{icon:{iconUrl:"/imgs/pin.svg",iconSize:[48,48]},location:{lat:-10.0065814,line:!0,lon:-36.0272124,zoom:12},media:{caption:"",credit:"Fotografia: Renan Carvalho",url:"jequia13.jpg",type:"image"},text:{headline:"Prainha",text:"<span>\xD3timo espa\xE7o de lazer e banho para curtir com a fam\xEDlia, com o privil\xE9gio da proximidade aos manguezais e ao encontro de rio e lagoa.</span><br>"}},{icon:{iconUrl:"/imgs/pin.svg",iconSize:[48,48]},location:{lat:-10.0043118,line:!0,lon:-36.0278889,zoom:12},media:{caption:"",credit:"",url:"jequia14.jpg",type:"image"},text:{headline:"Campo da Lagoa",text:"<div><span>Localizado pr\xF3ximo ao povoado de Ponta de Pedra, disp\xF5e de quadra poliesportiva e \xE9 ponto de encontro dos jovens da regi\xE3o.</span></div><div><span><br></span></div>"}},{icon:{iconUrl:"/imgs/pin.svg",iconSize:[48,48]},location:{lat:-10.047129,line:!0,lon:-36.031578,zoom:12},media:{caption:"",credit:"Fotografia: Anaires Galdino",url:"jequia15.jpg",type:"image"},text:{headline:"Barra de Jequi\xE1",text:"<span>A Barra de Jequi\xE1 \xE9 um encontro de rio e mar, com&nbsp;barracas pr\xF3ximas, frequentadas por turistas e nativos da regi\xE3o. L\xE1 s\xE3o servidos pratos deliciosos, como petiscos, mariscos, entre outras degusta\xE7\xF5es, como o caldinho de siri, que vem direto da regi\xE3o lagunar.</span><br>"}},{icon:{iconUrl:"/imgs/pin.svg",iconSize:[48,48]},location:{lat:-10.049938071749887,line:!0,lon:-36.0315292298187,zoom:12},media:{caption:"",credit:"Fotografia e texto: Renan Carvalho",url:"jequia16.jpg",type:"image"},text:{headline:"Artesanato da Barra de Jequi\xE1",text:"<div><span>Espa\xE7o onde artes\xE3os da regi\xE3o exp\xF5em e vendem suas artes, como a artes\xE3 Vilma Miranda, que vende artesanato h\xE1 mais de 10 anos na Barra de Jequi\xE1. Ela produz porta-guardanapo com palha de ouricuri, prendedor de cabelo com tecido de vi\xE9s e porta-agenda feito de palito de picol\xE9.<br></span></div><div><br><span></span></div>"}},{icon:{iconUrl:"/imgs/pin.svg",iconSize:[48,48]},location:{lat:-9.969521320504679,line:!0,lon:-36.03621363498817,zoom:12},media:{caption:"",credit:"Fotografia: Thaysia Marques",url:"jequia17.jpg",type:"image"},text:{headline:"Banho das Pedras",text:"<div><span>Banho das Pedras \xE9 um banho de lazer localizado no primeiro povoado depois do centro de Jequi\xE1 da Praia, onde v\xE1rias fam\xEDlias se re\xFAnem no fim de semana para aproveitar um banho refrescante.<br></span></div><div><br><span></span></div>"}}],d=[{section:"oficinas",values:[{title:"V\xEDdeo",names:["Soraya La Brunny dos Santos","Luis Wellington Ten\xF3rio da Rocha","Pietro"]},{title:"Fotografia",names:["Anaires Galdino da Silva","Deyvillanne dos Santos Fidelis","Luiz Henrique Lima da Concei\xE7\xE3o de Jesus","Renan Santos de Carvalho","Thaysia Marques dos Santos"]},{title:"Atua\xE7\xE3o para Redes Sociais",names:["Rosane da Concei\xE7\xE3o Pereira","Carlos Daniel dos Santos Silva","Jamille Lu\xEDs Soares","Mileide Pereira dos Santos"]},{title:"Produ\xE7\xE3o",names:["Leticia dos Santos Belo","Raiane Jamile Domingos Torres","Ana Luiza Lima da Concei\xE7\xE3o de Jesus"]},{title:"Edi\xE7\xE3o",names:["H\xE9lder Rocha dos Santos"]},{title:"Programa\xE7\xE3o",names:["Keline Rosa Pina de Jesus","Daniel Felipe Santos Bispo","Gabriel Mariano Heleno doa Santos","Ezequias Emanuell Araujo dos Santos"]}]},{section:"extras",values:[{title:"M\xFAsicas",names:["Chao do Pife","Bandinha de P\xEDfano de Jequi\xE1","Man\xE9 do Ros\xE1rio de Poxim"]},{title:"Imagens de Drone",names:["PJM Drone ","Imagens Brasil Sul "]},{title:"Imagens Subaqu\xE1ticas",names:["Adair Ribeiro Jr","Genivaldo Rodrigues"]},{title:"Motorista",names:["Marcos Antonio","Paulista"]},{title:"Apoio aos cuidados da casa e alimenta\xE7\xE3o",names:["Vera Lucia dos Santos"]}]},{section:"agradecimentos",values:[{title:"",names:["Prefeitura de Jequi\xE1 da Praia","Secretaria de Cultura na pessoa de Paulo C\xE9sar L. da Silva","Secretaria de Turismo na pessoa de Rafael Antenor Matias dos Santos","Secretaria de Educa\xE7\xE3o na pessoa de Monalisa Albuquerque Barros Curvello","Escola municipal Maria Lopes Bertoldo na pessoa de Fernando Antonio Angelo da Silva Junior","Secretaria de Transporte e tr\xE2nsito urbano na pessoa de Victor de Goes Dourado Gomes"]},{title:"Aos agentes culturais que facilitaram e acolheram t\xE3o bem a equipe do projeto",names:["Carlos Daniel dos Santos Silva","Joyce Kelly"]},{title:"Equipe Escola Maria Lopes Bertoldo",names:["Maria Claudete Ferreira da Silva","Adenilda Quintino de Jesus"]},{title:"Equipe Prefeitura",names:["Carlos Daniel dos Santos Silva","Joyce Kelly","Mariane Rodrigues","Ana Paula da Silva"]},{title:"Desenvolvimento de metodologia",names:["Amanda Moa","Evelyn Gomes","Eduardo Liron","Glauber Xavier"]},{title:"Produ\xE7\xE3o",names:["Renata Czarny"]}]}],l={name:t,info:r,slides:s,about:d},c="Marechal Deodoro",m="Cidade banhada pelas lagoas Munda\xFA e Manguaba que \xE9 Patrim\xF4nio Hist\xF3rico Nacional",p=[{icon:{iconUrl:"/imgs/pin.svg",iconSize:[48,48]},location:{lat:-9.723746,line:!0,lon:-35.811937,zoom:12},media:{caption:"",credit:"",url:"https://vimeo.com/699552073",type:"video"},text:{headline:"Barra Nova",text:"<span>Povoado de Marechal Deodoro conhecido principalmente pela Prainha.</span>"}},{icon:{iconUrl:"/imgs/pin.svg",iconSize:[48,48]},location:{lat:-9.737749988648028,line:!0,lon:-35.83440863936334,zoom:20},media:{caption:"",credit:"",url:"marechal0.jpg",type:"image"},text:{headline:"Drive Cocada Cultura",text:"<span>Espa\xE7o destinado para as cocadeiras da Massagueira venderem seus produtos em seguran\xE7a, j\xE1 que antes elas vendiam na beira da pista.</span>"}},{icon:{iconUrl:"/imgs/pin.svg",iconSize:[48,48]},location:{lat:-9.77106,line:!0,lon:-35.842126,zoom:17},media:{caption:"",credit:"",url:"https://vimeo.com/699577084",type:"video"},text:{headline:"Vila dos Pescadores (S. Mois\xE9s)",text:"<span>Seu Mois\xE9s \xE9 pescador e nativo da Praia do Franc\xEAs, de onde se considera um dos fundadores tamb\xE9m por sua descend\xEAncia portuguesa. Apaixonado pela praia, ele cuida da vila dos pescadores varrendo as ruas e zelando pelo local. </span><br><br>"}},{icon:{iconUrl:"/imgs/pin.svg",iconSize:[48,48]},location:{lat:-9.732929607290007,line:!0,lon:-35.891279787343535,zoom:16},media:{caption:"",credit:"",url:"marechal1.jpg",type:"image"},text:{headline:"Igreja N S do Bonfim",text:"<span>Primeira igreja cat\xF3lica da cidade.</span><br>"}},{icon:{iconUrl:"/imgs/pin.svg",iconSize:[48,48]},location:{lat:-9.720796746807139,line:!0,lon:-35.895239618003075,zoom:15},media:{caption:"",credit:"",url:"marechal2.jpg",type:"image"},text:{headline:"Igreja N S da Concei\xE7\xE3o",text:"<span>Igreja matriz, onde fica a padroeira da cidade.</span><br>"}},{icon:{iconUrl:"/imgs/pin.svg",iconSize:[48,48]},location:{lat:-9.720796746807139,line:!0,lon:-35.895239618003075,zoom:17},media:{caption:"",credit:"",url:"marechal3.jpg",type:"image"},text:{headline:"Filarmonica Santa Cec\xEDlia",text:"<span>Filarm\xF4nica mais antiga do estado de Alagoas em atividade, com 111 anos de funda\xE7\xE3o.</span><br>"}},{icon:{iconUrl:"/imgs/pin.svg",iconSize:[48,48]},location:{lat:-9.717585346333397,line:!0,lon:-35.89545856035891,zoom:12},media:{caption:"",credit:"",url:"https://vimeo.com/699530291",type:"video"},text:{headline:"Banda de P\xEDfano (Matriz)",text:"<span>Grupo que anda pelas ruas das cidades pedindo ajuda atrav\xE9s da arte.</span><br><br>"}},{icon:{iconUrl:"/imgs/pin.svg",iconSize:[48,48]},location:{lat:-9.72000437154396,line:!0,lon:-35.895533202659024,zoom:15},media:{caption:"",credit:"",url:"marechal4.jpg",type:"image"},text:{headline:"Casa da C\xE2mara e Antiga Cadeia",text:"<span>Constru\xE7\xE3o do s\xE9culo 19 que primeiramente foi um armaz\xE9m de sal, mas tamb\xE9m j\xE1 funcionou como Casa da C\xE2mara e como cadeia. Atualmente sedia a Secretaria de Cultura do munic\xEDpio de Marechal Deodoro.</span><br><br>"}},{icon:{iconUrl:"/imgs/pin.svg",iconSize:[48,48]},location:{lat:-9.719429072606925,line:!0,lon:-35.89406930193232,zoom:17},media:{caption:"",credit:"",url:"marechal5.jpg",type:"image"},text:{headline:"Col\xF4nia dos Pescadores",text:"<span>Associa\xE7\xE3o que representa os pescadores.</span><br>"}},{icon:{iconUrl:"/imgs/pin.svg",iconSize:[48,48]},location:{lat:-9.716847,line:!0,lon:-35.892266,zoom:19},media:{caption:"",credit:"",url:"https://vimeo.com/699519130",type:"video"},text:{headline:"Cais da Lancha",text:"<span>Ponte usada para embarque e desembarque de passageiros de uma lancha que fazia o trajeto at\xE9 a capital Macei\xF3.</span><br>"}},{icon:{iconUrl:"/imgs/pin.svg",iconSize:[48,48]},location:{lat:-9.712767,line:!0,lon:-35.891948,zoom:17},media:{caption:"",credit:"",url:"marechal6.jpg",type:"image"},text:{headline:"Mucuri",text:"<span>Estabelecimento culin\xE1rio com uma nova proposta de ambiente gastron\xF4mico e cultural para o centro hist\xF3rico de Marechal Deodoro.</span><br><br>"}},{icon:{iconUrl:"/imgs/pin.svg",iconSize:[48,48]},location:{lat:-9.716689,line:!0,lon:-35.89388,zoom:13},media:{caption:"",credit:"",url:"marechal7.jpg",type:"image"},text:{headline:"Centro Hist\xF3rico",text:"<span>Local onde predomina a arquitetura preservada desde a \xE9poca da coloniza\xE7\xE3o.</span><br>"}},{icon:{iconUrl:"/imgs/pin.svg",iconSize:[48,48]},location:{lat:-9.715605157103187,line:!0,lon:-35.8938965732735,zoom:14},media:{caption:"",credit:"",url:"marechal8.jpg",type:"image"},text:{headline:"Mercado das Rendas e Bordados",text:"<span>Ponto comercial atribu\xEDdo para as rendeiras da cidade.</span><br>"}},{icon:{iconUrl:"/imgs/pin.svg",iconSize:[48,48]},location:{lat:-9.720458873441684,line:!0,lon:-35.89559691803075,zoom:20},media:{caption:"",credit:"",url:"marechal9.jpg",type:"image"},text:{headline:"Filarmonica Carlos Gomes",text:"<span>Segunda filarm\xF4nica mais antiga da cidade, atualmente com 106 anos de funda\xE7\xE3o.</span><br>"}},{icon:{iconUrl:"/imgs/pin.svg",iconSize:[48,48]},location:{lat:-9.717585346333397,line:!0,lon:-35.89545856035891,zoom:19},media:{caption:"",credit:"",url:"marechal10.jpg",type:"image"},text:{headline:"Casas em risco de desabamento",text:"<span>Estruturas do s\xE9culo 17 que est\xE3o caindo por falta de restaura\xE7\xE3o.</span><br>"}},{icon:{iconUrl:"/imgs/pin.svg",iconSize:[48,48]},location:{lat:-9.716764399882639,line:!0,lon:-35.8924618179767,zoom:17},media:{caption:"",credit:"",url:"https://vimeo.com/699517948",type:"video"},text:{headline:"Nova Orla Lagunar",text:"<span>Reurbaniza\xE7\xE3o de uma pequena vila \xE0s margens da lagoa, que costumava sofrer com as chuvas e mar\xE9s cheias. </span><br><br>"}}],u=[{section:"oficinas",values:[{title:"V\xEDdeo",names:["Delanisson de Ara\xFAjo Pereira"]},{title:"Fotografia",names:["Jo\xE3o Pedro dos Santos","Gabriel Nunes Xavier","Gustavo Henrique dos Santos"]},{title:"Atua\xE7\xE3o para Redes Sociais",names:["Franklin Lisboa de Lima","Nalbert Norberto dos Santos"]},{title:"Produ\xE7\xE3o",names:["Nalbert Norberto dos Santos","Edmar de Castro Neto","Franklin Lisboa de Lima","Gustavo Henrique dos Santos","Delanisson de Ara\xFAjo Pereira"]},{title:"Edi\xE7\xE3o",names:["Jo\xE3o Vitor Santos da Silva","Francisco Nunes Xavier"]},{title:"Programa\xE7\xE3o",names:["Francisco Nunes Xavier","Gabriel Larramendi"]}]},{section:"extras",values:[{title:"M\xFAsicas",names:["Mestre Jos\xE9 C\xEDcero e Banda Esqueta Mui\u1EBD","Filarm\xF4nica Santa Cec\xEDlia","Nelson da Rabeca"]},{title:"Motorista",names:["Marcos Antonio"]},{title:"Apoio aos cuidados da casa e alimenta\xE7\xE3o",names:["Vera Lucia dos Santos"]}]},{section:"agradecimentos",values:[{title:"",names:["IFAL - Campus Marechal Deodoro"]},{title:"Equipe IFAL",names:["Ac\xE1ssia Deli\xEA"]},{title:"Desenvolvimento de metodologia",names:["Amanda Moa","Evelyn Gomes","Eduardo Liron","Glauber Xavier"]},{title:"Produ\xE7\xE3o",names:["Renata Czarny"]}]}],g={name:c,info:m,slides:p,about:u},v={coqueiroseco:n,jequiadapraia:l,marechaldeodoro:g};export{v as d};
